-- ----------------------------
-- Procedure structure for guardar_patrimonios_hijos
-- ----------------------------
DROP PROCEDURE IF EXISTS `guardar_patrimonios_hijos`;
delimiter ;;
CREATE PROCEDURE `guardar_patrimonios_hijos`(IN dependencia_buscada INT)
BEGIN
	    DECLARE done INT DEFAULT FALSE;
    DECLARE valor_columna VARCHAR(6);
    
    -- Declarar un cursor para la consulta SELECT
    DECLARE cur CURSOR FOR SELECT id FROM dependencia WHERE parent_id = dependencia_buscada;
    
    -- Manejar el final de los resultados
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
		-- Inserto en la tabla temporal 'pruebo' la etiqueta del bulto actual
		
    -- Abrir el cursor
    OPEN cur;
    
    -- Iniciar el bucle para recorrer las filas
    my_loop: LOOP
        -- Obtener el siguiente valor de la columna
        FETCH cur INTO valor_columna;
        
        -- Salir del bucle si no hay más resultados
        IF done THEN
            LEAVE my_loop;
        END IF;
        
				-- Llamo al propio sp de forma recursiva, pasandole las etiquetas que va recorriendo el CURSOR
				call guardar_patrimonios_hijos(valor_columna);
				
    END LOOP;
    
    -- Cerrar el cursor cuando hayas terminado
    CLOSE cur;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for obtener_responsables_recursivo
-- ----------------------------
DROP PROCEDURE IF EXISTS `obtener_responsables_recursivo`;
delimiter ;;
CREATE PROCEDURE `obtener_responsables_recursivo`(IN dependencia_buscada INT)
BEGIN
		SET @@session.max_sp_recursion_depth = 255; 
	
	-- sp que se llama de forma recursiva, y termina guardando enla tabla temp todos los bultos hijos
	call guardar_patrimonios_hijos(dependencia_buscada);
	
	SET @@session.max_sp_recursion_depth = 0; 

END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
